import React, { useEffect, useState } from "react";
import { FixedSizeList, ListChildComponentProps } from 'react-window';
import { useAppDispatch, useAppSelector } from "../../../../redux/hooks";
import { fetchUsersListAsync } from "./userSlice";
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';

const FirstList: React.FC<{ }> = () => {

  const [isLoading, setIsLoading] = useState<boolean>(false);
  const dispatch = useAppDispatch();

  async function getFirstList() {
    dispatch(fetchUsersListAsync());
  }

  const { users, loading } = useAppSelector(
    (state) => state.user
  );

  useEffect(() => {
    getFirstList()
  },[])

  function renderRow(props: ListChildComponentProps) {
    const { index, style } = props;
  
    return (
      <ListItem style={style} key={index} component="div" disablePadding>
        <ListItemButton>
          <ListItemText primary={`Item ${index + 1}`} />
        </ListItemButton>
      </ListItem>
    );
  }

  console.log("====", users)
  return (
    <div style={{
      backgroundColor: 'white',
      padding: '16px'
    }}>
      {
        loading ? (
          <div className="my-5 flex flex-col justify-start px-3">
            <label className="font-weight-light text-gray-regular">
              loading
            </label>
          </div>
        ) : users && users.length > 0 ? (
            <>
              {[...users].map((user: any, index: number) => (
                {renderRow}
              ))}
            </>
          ) 
         : (
          <div className="my-5 flex flex-col justify-start px-3">
            <label className="font-weight-light text-gray-regular">
              No Data
            </label>
          </div>
        )
      }
    </div>
  );
};

export default FirstList;
